import React from 'react';

import SplashScreen from './pages/SplashScreen1';


import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';

function App() {

  const Stack = createStackNavigator();

  return (
    <NavigationContainer>
      <Stack.Navigator
        screenOptions={{
          headerShown: false
        }}
      >
        <Stack.Screen

          name="SplashScreen1"
          component={SplashScreen1}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
